import React, { Component } from "react";
import logoNUSBITE from "./logoNUSBITE.gif";
import "./App.css";
import { supabase } from "./component/supabaseData";

export default function App() {
    const login = () => {
      supabase.auth.signIn({provider:"github"})
    }
    async function signInWithGoogle() {
      const { data, error } = await supabase.auth.signInWithOAuth({
        provider: 'google',
      })
    }
    const [session, setSession] = useState(null)

    useEffect(() => {
      supabase.auth.getSession().then(({ data: { session } }) => {
        setSession(session)
      })

      const {
        data: { subscription },
      } = supabase.auth.onAuthStateChange((_event, session) => {
        setSession(session)
      })

      return () => subscription.unsubscribe()
    }, [])
    function testlogin() {
    if (!session) {
      return (<Auth supabaseClient={supabase} appearance={{ theme: ThemeSupa }} />)
    }
    else {
      return (<div>Logged in!</div>)
    }
    }
    return (
      <div className="App">
        <header className="App-header">
          <h1>NUS Bite</h1>
          <img src={logoNUSBITE} className="App-logo" />
          <h3 className="login-header">login as</h3>
          <table className="id-table">
            <tr>
              <button
                onClick={testlogin}
                className="App-login-button-taster"
                href="https://reactjs.org"
              >
                <b>NUS Tasters</b>
              </button>

              <div className="blank-between-button"></div>

              <button
                className="App-login-button-hawker"
                href="https://reactjs.org"
              >
                <b>NUS Hawkers</b>
              </button>
            </tr>
          </table>
          <h2 className="or">—————OR—————</h2>
          <button
            className="App-login-button-visitor"
            href="https://reactjs.org"
          >
            <b>NUS Visitor</b>
          </button>
        </header>
      </div>
    );
}
